// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract TreasuryAdmin is Ownable {
    using SafeERC20 for IERC20;

    address private constant addressZero = address(0x00000000000);
    address public admin;

    event withdrawEvent(uint256 amount, address indexed token);

    constructor(address _admin) {
        admin = _admin;
    }

    function balanceOf(address _token)
        external
        view
        onlyOwner
        returns (uint256)
    {
        return IERC20(_token).balanceOf(address(this));
    }

    function setAdmin(address _admin) external onlyOwner returns (address) {
        admin = _admin;
        return admin;
    }

    function withdraw(uint256 _amount)
        external
        payable
        onlyOwner
        returns (bool)
    {
        require(_amount <= address(this).balance);
        payable(admin).transfer(_amount);
        emit withdrawEvent(_amount, addressZero);
        return true;
    }

    function withdraw(address _token, uint256 _amount)
        external
        onlyOwner
        returns (bool)
    {
        IERC20 token = IERC20(_token);
        require(_amount <= token.balanceOf(address(this)));
        token.safeTransfer(admin, _amount);
        emit withdrawEvent(_amount, address(token));
        return true;
    }
}
